import React from "react";
import WeatherDay from "./WeatherDay";

const App = () => {
  return (
    <div>
      <h1 className="ui center aligned header"> Weather App </h1>
      <div className="ui container horizontal segments">
        <WeatherDay />
      </div>
    </div>
  );
};

export default App;
